import { observable, action } from 'mobx'

export default class CustomerServicesMenuStore {
  @observable citizenId = ''
  @action setProfile = (id, password) => {
    this.id = id
    this.password = password
  }
  @action setCitizenId = (id) => {
    console.log(id)
    this.citizenId = id
  }
}
